import './search.css';

const [formData, setformData] = useState({
    district:'',
    stream:'',
    zvaalue:''
})


const inpudata = (event) =>
{

}


function search() {
    return (
        <div className="form-container">
            <form  onClick={inpudata} >
          <h2 className="form-title">Submit Your Information</h2>
    
          <div className="form-group">
            <label htmlFor="district">Enter District</label>
            <input type="text" value={FormData.district} id="district" className="input-box" placeholder="Enter district" />
          </div>
    
          <div className="form-group">
            <label htmlFor="stream">Enter Stream</label>
            <input type="text" id="stream" value={formData.stream} className="input-box" placeholder="Enter stream" />
          </div>
    
          <div className="form-group z-range-group">
            <label>Enter Z-Value</label>
            <div className="z-range-inputs">
              <input type="text" className="z-range-box"  />
            </div>
          </div>
        <div className='box3'>
        <button className="submit-button">Submit</button>
        </div>
          </form>
        </div>
      );
    }

export default search;
